  render() {
    
    return (
      <div className="App">
          <ReactTypingAnimation>
            <div style={titleStyle}>
              <typing style={titleStyle}><span>Dslyxai</span></typing>
            </div>
          </ReactTypingAnimation>
      </div>
    );
  }
}

